import React from 'react'
import { ProjectItem } from './ProjectItem'

export const ProjectList = (props) => {
    return (
        props.projects.map((project) => (
            <div key={project.uniqueId} className='studentList'>
                <ProjectItem key={project.uniqueId} projectId={project.id} projectDescription={project.description} projectName={project.name} projectName={project.tags} isFavorite={project.isFavorite} addToFavorites={props.addToFavorites} deleteFromFavorites={props.deleteFromFavorites} />
            </div>
        ))
    )       
}
